review:
This is a bit of a code review, but it seems like you're trying to split a string by commas, and then assign the second and third parts of the split string to a map. It seems like you're doing this for each line of the file, but you're not checking if the split string has at least two parts. This could potentially cause an out of range error if the line doesn't have at least two parts.

You could add a check to make sure that the split string has at least two parts before trying to assign the second and third parts to the map. This would look something like this:
```go
for s.Scan() {
	parts := strings.Split(s.Text(), ":")
	if len(parts) < 2 {
		continue
	}
	...
}
```
This will skip any lines that don't have at least two parts, which should prevent the out of range error.

