review:
The defer udpConn.Close() should be moved to the end of the function, after the for loop. This way, the connection is closed only when the function ends, not when the error occurs.

The function should also return the error if it occurs, so that the caller can handle it appropriately.
Here is the corrected code:
```go
func startDnsServer() error {
	laddr := &net.UDPAddr{
		IP:   net.ParseIP("127.0.0.1"),
		Port: 53,
	}
	udpConn, err := net.ListenUDP("udp", laddr)
	if err!= nil {
		klog.Errorf("Dns server Start error : %s", err)
		return err
	defer udpConn.Close()
	dnsConn = udpConn
	for {
		req := make([]byte, bufSize)
		//...
}
```

